script: |
  super -f text -I q789.spq | sort > q789.out

inputs:
  - name: q789.spq
    data: |
      SELECT DISTINCT + col2 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT + 57 + - col1 IN ( - col0, col1, - + col0 / + 98 + - col1 * - 20 );
  - name: tab0

outputs:
  - name: q789.out
    data: |
      10
      47
      99
